import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const navigate = useNavigate();
  const [employeeData, setEmployeeData] = useState({
    username: '',
    position: '',
    loading: true
  });

  useEffect(() => {
    fetchEmployeeProfile();
  }, []);

  const fetchEmployeeProfile = async () => {
    try {
      const token = localStorage.getItem('token');
      const user = JSON.parse(localStorage.getItem('user'));
      
      if (!token || !user) {
        navigate('/');
        return;
      }

      // Llamada al backend para obtener información completa del empleado
      const response = await fetch('http://localhost:5000/api/empleados/profile', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      const data = await response.json();
      
      if (response.ok && data.success) {
        setEmployeeData({
          username: data.employee.username,
          position: data.employee.position,
          loading: false
        });
      } else {
        // Fallback a datos del localStorage si falla la API
        setEmployeeData({
          username: user.username || 'Empleado',
          position: 'Cargando...',
          loading: false
        });
      }
    } catch (error) {
      console.error('Error fetching employee profile:', error);
      const user = JSON.parse(localStorage.getItem('user'));
      setEmployeeData({
        username: user?.username || 'Empleado',
        position: 'Sin datos',
        loading: false
      });
    }
  };

  const handleLogout = () => {
    if (window.confirm('¿Estás seguro de que quieres cerrar sesión?')) {
      try {
        localStorage.removeItem('token');
        localStorage.removeItem('user');
        console.log('Sesión cerrada correctamente');
        navigate('/');
      } catch (error) {
        console.error('Error al cerrar sesión:', error);
        navigate('/');
      }
    }
  };

  const getPositionIcon = (position) => {
    const icons = {
      'Barbero': '✂️',
      'Estilista': '💇‍♀️',
      'Coach': '🏋️‍♂️'
    };
    return icons[position] || '👨‍💼';
  };

  const getGreeting = () => {
    const hour = new Date().getHours();
    if (hour < 12) return '¡Buenos días!';
    if (hour < 18) return '¡Buenas tardes!';
    return '¡Buenas noches!';
  };

  if (employeeData.loading) {
    return (
      <header className="employee-header">
        <div className="header-content">
          <div className="logo-section">
            <img src="cloudfit_l.png" alt="CloudFit" className="header-logo" />
          </div>
          <div className="loading-profile">
            <div className="loading-spinner"></div>
            <span>Cargando...</span>
          </div>
        </div>
      </header>
    );
  }

  return (
    <header className="employee-header">
      <div className="header-content">
        <div className="logo-section">
          <img src="cloudfit_l.png" alt="CloudFit" className="header-logo" />
          <div className="company-name">
            <span className="cloud-text">CLOUD</span>
            <span className="fit-text">FIT</span>
          </div>
        </div>
        
        <div className="employee-profile">
          <div className="greeting">
            <span className="greeting-text">{getGreeting()}</span>
          </div>
          
          <div className="profile-info">
            <div className="position-badge">
              <span className="position-icon">{getPositionIcon(employeeData.position)}</span>
              <span className="position-text">{employeeData.position}</span>
            </div>
            
            <div className="username-section">
              <span className="at-symbol">@</span>
              <span className="username">{employeeData.username}</span>
            </div>
          </div>
          
          <button className="logout-btn" onClick={handleLogout}>
            <span className="logout-icon">🚪</span>
            <span className="logout-text">Salir</span>
          </button>
        </div>
      </div>
    </header>
  );
};

export default Header;
